import React from 'react';
import styled from 'styled-components';

const Projects = () => {
  return (
    <Wrapper>
      <H2>featured projects</H2>
      <Description>
        Keg inventory system using Untappd API integration & MongoDB Atlas.
        Frontend: React
        Backend: Node.js & Express
      </Description>
      
      <div>
        Group Project
      </div>

      <div>
        Dogspace
      </div>

      <div>
        Twitter Clone
      </div>

      <div>
        Bob's Burgers game
      </div>
    </Wrapper>
  )
}

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  height: 100vh;
  width: 100vw;
`;

const H2 = styled.h2`
  text-transform: uppercase;
  font-size: 2rem;
  font-weight: 700;
`;

const Description = styled.div`
  display: flex;
  flex-direction: column;
`;

export default Projects
